import './App.css';
import { Login, ProtectedRoute, Dashboard, Contact, Blog } from './Components';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import React from 'react';

function Test() {
  return (
    <Route path='test' element={
      <h1>Hello test</h1>
    } />
  );
}

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
        <Routes>
          <Route
            path='/login'
            element={
              <Login></Login>
            } />
          <Route
            path="/"
            element={
              <ProtectedRoute>
                <Dashboard></Dashboard>
              </ProtectedRoute>
            } >
            {Test()}
          </Route>
          <Route
            path="/blog"
            element={
              <ProtectedRoute>
                <Blog />
              </ProtectedRoute>
            } />
          <Route
            path="/contact"
            element={
              <ProtectedRoute>
                <Contact />
              </ProtectedRoute>
            } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
